import React, { Component } from 'react'
import HorizontalScroll from 'react-scroll-horizontal'
import GroupIcon from './GroupIcon'
import { connect } from 'react-redux'
import { bindActionCreators } from 'redux'
import * as groupActions from '../../../../services/redux/actions/group'
import * as imageActions from '../../../../services/redux/actions/image'
import {
    CImg, 
    CTooltip
  } from '@coreui/react'
import NewGroup from 'src/views/popups/NewGroup'
import notification from '../../../../services/models/others/notification'
import Notification from '../../../common/Notification'
import Confirmation from 'src/views/common/Confirmation'

export class ScrollHorizontal extends Component {
    constructor(props){
        super(props);
        this.state = {
            isLoading: true,
            failed: false,
            groups: [],
            showPopUpGroup: false,
            createResults: [],
            showConfirmation: false,
            deleteId: "",
        }
    }
    async componentDidMount(){
        await this.props.getGroups();
        const groups = this.props.group.groups;
        this.setState({
            isLoading: this.props.group.isLoading,
            failed: this.props.group.failed,
            groups: [...groups]
        })
    }

    onDiscardPopUp = () => {
        this.setState({showPopUpGroup: false});
    }

    onDiscardConfirmation = () => {
        this.setState({showConfirmation: false});
    }

    onSave = () => {
        this.onDelete(this.state.deleteId);
        this.setState({ showConfirmation: false });
    }

    onAcceptPopUp = async(group, file) => {
        
        console.log(file)
        const data = new FormData();
        data.append("name", group.logo);
        data.append("file", file);
        console.log("sigo vivo")
        console.log(data)
        await this.props.saveImage(data);
        await this.props.createGroup(group);
        const failed = this.props.group.failed;
        let newNotification;
        if(failed){
            newNotification = new notification('danger', 'Hubo un problema', 'No se pudo registrar a la agrupación.'); 
        }
        else{
            newNotification = new notification('success', 'Registro exitoso', 'Agrupación registrada correctamente.');
            await this.props.getGroups();
            const groups = this.props.group.groups;
            this.setState({ groups: groups });
        }
        this.setState({createResults: [...this.state.createResults, newNotification]});
        this.setState({ showPopUpGroup: false });
    }

    onAddGroup = () => {
        this.setState({ showPopUpGroup: true });
    }

    onSubmit = (id) => {
        this.setState({ deleteId: id })
        this.setState({showConfirmation: true});

    }

    onDelete = async (id) => {
        console.log("se borra " + id)
        await this.props.deleteGroup(id);
        const failed = this.props.group.failed;
        let newNotification;
        if(failed){
            newNotification = new notification('danger', 'Hubo un problema', 'No se pudo eliminar la agrupación'); 
        }
        else{
            newNotification = new notification('success', 'Eliminación exitosa', 'Agrupación eliminada correctamente.'); 
            await this.props.getGroups();
            this.setState({groups: this.props.group.groups});
        }
        this.setState({createResults: [...this.state.createResults, newNotification]});

    }

    render() {
        const { createResults } = this.state;
        return (
            <div className="stories">
                { createResults.map((notification, index) => <Notification key={index} mode={notification.mode} title={notification.title} body={notification.body}></Notification> )}
                <HorizontalScroll className="scroll" reverseScroll={true}>


                    <div className="borde">
                        <CTooltip content="Nueva Alianza" placement='top'>
                            <CImg 
                                shape="rounded-circle"
                                width="200px"
                                height="200px"
                                block={true}
                                className={`iconoAgrupacion small`}
                                src="https://upload.wikimedia.org/wikipedia/commons/thumb/c/ce/Plus_font_awesome.svg/1200px-Plus_font_awesome.svg.png"
                                alt="añadir usuario"
                                onClick={this.onAddGroup}
                            />
                        </CTooltip>
                    </div>

                    
                    { this.state.groups.map((group, index) => <GroupIcon
                        iconSize="small"
                        image={group.logo === "aa" ? "https://iusetveritas.com/web/wp-content/uploads/2020/05/Logo-ius-et-veritas.png" : "http://localhost:3001/images/" + group.logo}
                        name={group.name}
                        id={group._id}
                        onSubmit={this.onSubmit}
                        key={index}
                        />
                    ) }
                    <GroupIcon name="{group.name}" iconSize="small" image="data:image/png;base64,"/>
                    <GroupIcon name="{group.name}" iconSize="small" image="https://iusetveritas.com/web/wp-content/uploads/2020/05/Logo-ius-et-veritas.png"/>
                    <GroupIcon iconSize="small" name="{group.name}" image="data:image/png;base64,"/>
                    <GroupIcon iconSize="small" name="{group.name}" image="https://iusetveritas.com/web/wp-content/uploads/2020/05/Logo-ius-et-veritas.png"/>
                    <GroupIcon iconSize="small" name="{group.name}" image="https://iusetveritas.com/web/wp-content/uploads/2020/05/Logo-ius-et-veritas.png"/>
                    <GroupIcon iconSize="small" name="{group.name}" image="data:image/png;base64,"/>
                    <GroupIcon iconSize="small" name="{group.name}" image="https://iusetveritas.com/web/wp-content/uploads/2020/05/Logo-ius-et-veritas.png"/>
                    <GroupIcon iconSize="small" name="{group.name}" image="https://iusetveritas.com/web/wp-content/uploads/2020/05/Logo-ius-et-veritas.png"/>
                </HorizontalScroll>
                {this.state.showConfirmation ? <Confirmation color='danger' onAccept={this.onSave} onDiscard={this.onDiscardConfirmation} title={'Borrar Alianza'} message={'¿Está seguro de borrar esta agrupación?'}></Confirmation> : null}
                {this.state.showPopUpGroup ? <NewGroup onAccept={this.onAcceptPopUp} onDiscard={this.onDiscardPopUp} ></NewGroup> : null}
            </div>
        )
    }
}

const mapStateToProps = state => {
    return {
        group: state.group
    }
}

const mapDispatchToProps = dispatch => {
    return {
        ...bindActionCreators(Object.assign({},groupActions, imageActions), dispatch)
    }
}

export default connect(mapStateToProps, mapDispatchToProps)(ScrollHorizontal)